import "../Header/Header.css";
import Image1 from "../Header/images.png";
import ReactDOM from "react-dom";
const name = "Flash";
const currDate = new Date().toLocaleDateString();
const currTime = new Date().toLocaleTimeString();

const Header = () => {
  
  return (
    <div>
      <header className="header">
        <div>
          <img className="imagediv" src={Image1} alt=""></img>
        </div>
        <p className="p1">{currDate}</p>
        <p className="p1">{currTime}</p>

      </header>

      <div className="parentdivlogin">
        <div>
          <p id="p1">LOGIN</p>
        </div>
        <div className="userlogin">
          {/* <label htmlFor="">UserName</label> */}
          <input type="text" name="" id="ull" placeholder="Enter your UserName" />
        </div>

        <div className="userLogin">
              <input
            type="password"
            name=""
            id="ull"
            placeholder="Enter your Password"
          />
        </div>
        <div>
          <button type="submit">Login</button>
        </div>
      </div>
     
    </div>
  );
};

export default Header;
